  root: {
    textAlign: 'center',
    alignItems: 'center',
  }
});

const Templates = (metaDatas) => {
  console.log(metaDatas);
  const {root} = useStyles();
  return (
    <div className={root}>
    <NftList metaDatas={metaDatas} />
    </div>
  )
}

export default Templates;
